import React from "react";
import "./splash.css";

export default function Splash({ imgUrl }) {
    return (
        <div className="splash uk-flex uk-flex-center uk-flex-middle">
            <img src={imgUrl} alt="Indigo Ball Logo" />
        </div>
    )
}
